/*Table structure for table `sys_parameter` */

DROP TABLE IF EXISTS `sys_parameter`;

CREATE TABLE `sys_parameter` (
  `PARAMNAME` varchar(20) NOT NULL COMMENT '参数名',
  `PARAMVALUE` text NOT NULL COMMENT '参数值',
  `COMMENTS` varchar(250) default NULL COMMENT '参数描述',
  `CREATETIME` datetime default NULL COMMENT '创建时间',
  `typeid` smallint(2) default '2' COMMENT '1系统参数2网站参数',
  PRIMARY KEY  (`PARAMNAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统参数信息';

/*Data for the table `sys_parameter` */

insert  into `sys_parameter`(`PARAMNAME`,`PARAMVALUE`,`COMMENTS`,`CREATETIME`,`typeid`) values ('resourcepath','../','查看网站上传的图片和视频的链接','2009-04-20 02:02:02',1),('resourcepathmanage','../','后台上传的图片路径等','2009-04-20 02:02:02',1),('sysname','重庆移动GPRS业务支撑平台','系统名称,不能删除','2009-04-20 02:02:02',1);

/*Table structure for table `sys_right` */

DROP TABLE IF EXISTS `sys_right`;

CREATE TABLE `sys_right` (
  `RIGHTCODE` varchar(20) NOT NULL COMMENT '权限标示',
  `RIGHTNAME` varchar(20) NOT NULL COMMENT '功能名称',
  `PARENTCODE` varchar(20) NOT NULL COMMENT '所属父模块代码，所在的功能或者模块',
  `LOGFLAG` tinyint(1) default '0' COMMENT '是否记录日志\r\n            1记录0不记录',
  `ISMENU` tinyint(1) default '1' COMMENT '是否菜单\r\n            如果是菜单的话,这里一定要显示对应的链接 1是0否',
  `ISCOMMON` tinyint(1) default '0' COMMENT '是否公用功能\r\n            1是0否',
  `GRADE` smallint(6) default '1' COMMENT '权限树的级别,顶级为1，子级为2，依次类推，作用在于显示菜单树的时候，按顺序来',
  `ORDERID` smallint(6) default '1' COMMENT '显示顺序\r\n            对menulevel和parentid都相同的起作用',
  `IMAGEURL` char(10) default NULL,
  `LINKURL` varchar(300) default NULL COMMENT '链接地址',
  `COMMENTS` varchar(200) default NULL COMMENT '描述内容',
  `OPENTARGET` varchar(20) default 'mainFrame' COMMENT '在哪个frame中打开',
  PRIMARY KEY  (`RIGHTCODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统权限信息';

