/*Table structure for table `sys_role` */

DROP TABLE IF EXISTS `sys_role`;

CREATE TABLE `sys_role` (
  `ROLEID` int(11) NOT NULL auto_increment COMMENT '角色标示',
  `ROLENAME` varchar(50) default NULL COMMENT '角色名',
  `COMMENTS` text COMMENT '角色描述',
  `CREATEUSER` varchar(10) default NULL COMMENT '创建人员',
  `CREATETIME` datetime default NULL COMMENT '创建时间',
  `GRADEID` int(10) unsigned NOT NULL default '0',
  PRIMARY KEY  (`ROLEID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统角色信息';

