/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `USERID` int(11) NOT NULL auto_increment COMMENT '用户标示',
  `GROUPID` int(11) default NULL COMMENT '组信息',
  `LOGINNAME` varchar(40) NOT NULL COMMENT '登录名',
  `USERNAME` varchar(20) default NULL COMMENT '用户姓名',
  `STYLE` varchar(15) default NULL COMMENT '对应的css',
  `GENDER` varchar(2) default NULL COMMENT '性别,男G,女M',
  `EMPLOYEENO` varchar(15) default NULL COMMENT '在公司的工号',
  `PASSWORD` varchar(40) NOT NULL COMMENT 'md5后的密码',
  `STATUS` smallint(6) default NULL COMMENT '状态\r\n            0启用1 冻结 2其他禁用状态',
  `EMAIL` varchar(50) default NULL COMMENT '邮件',
  `DELFLAG` tinyint(1) default NULL COMMENT '是否删除\r\n            1删除0未删除',
  `OFFICEPHONE` varchar(20) default NULL COMMENT '办公电话',
  `MOBILE` varchar(20) default NULL COMMENT '手机',
  `COMMENTS` varchar(300) default NULL COMMENT '描述',
  `CREATEUSER` varchar(40) default NULL COMMENT '创建人员',
  `CREATETIME` datetime default NULL COMMENT '创建时间',
  `MODIFY_TIME` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,
  PRIMARY KEY  (`USERID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统用户信息';

